import logo from './logo.svg';
import './App.css';
import {Button,Icon} from 'semantic-ui-react'

function App() {
  return (
    <div className="button">
     <Button>
       <Button.Content visible>hi</Button.Content>
       <Button.Content hidden>bye</Button.Content>
     </Button>
    </div>
  );
}

export default App;
